import React,{ useState } from 'react'
import { FaGithub , FaLinkedin , FaFacebook} from 'react-icons/fa';
import Images from './Images/Jenan.jpg'
// import { IconContext } from 'react-icons'
// import 'bootstrap/dist/css/bootstrap.min.css'; 
import './Card1.css'





function Card() {
  const [name] = useState('Jenan Musallam');
  const [place] = useState('Amman / Jordan');
  const [job] = useState('Management Information System');
  const [about] = useState(' بس رشة ليمون');
 

  return (
    // Card
  <div className="Card">
     {/* Upper Container */}

     <div className='upper-container'>
     {/* Image Container */}

       <div className='image-container'>
       
       {/* Image */}
      <img src="Images/Jenan.jpg" alt=" " height="150px" width="150px" />
      </div>
    </div>

     {/* Lower Container */}
     
    <div className="lower-container">
       <h2>{ name }</h2>
       <small>{ place }</small> <br/>
       <small>{ job }</small> <br/> <br/>
       <h5>{ about }</h5> <br/> <br/>
       {/* ================= */}
       {/* <IconContext.Provider value={{ color:"lightgray"}}> */}
      

      {/* Social Media */}
         <div className="SocialMedia">
         <a href="https://github.com/Abdaljawad-Ayah">
         <FaGithub size={35}/>
         </a>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 
         <a href="https://www.linkedin.com/in/ayah-imad/">
         <FaLinkedin size={35}/>
         </a>&nbsp; &nbsp;  &nbsp; &nbsp; &nbsp; 
         <a href="https://web.facebook.com/ayah.imad.7">
         <FaFacebook size={35}/>
         </a>
         </div>
         {/* The End Of Social Media */}
      
       {/* </IconContext.Provider> */}
       
    </div>
  </div> 
  )
}

export default Card
